import React from 'react'
import reactStars from 'react-rating-stars-component'

export const Filter = () => {
    return (
        <div>
            <h3>Search by Text</h3>
            <input type='text' />
            <h3>Search by Rate</h3>
            <reactStars
                count={5}
                edit={false}
                size={24}
                activeColor="#ffd700"
                value={5}
                     /> 
        </div>
    )
}
